import tkinter as tk
from tkinter import filedialog, messagebox, ttk
from pdf2image import convert_from_path
import pytesseract
import os
import sys
from PIL import Image, ImageTk
import threading
import time
from pypdf import PdfReader, PdfWriter
import fitz
import webbrowser
import base64
import io

class Tooltip:
    def __init__(self, widget, text):
        self.widget = widget
        self.text = text
        self.tooltip_window = None
        self.show_id = None
        self.widget.bind("<Enter>", self.schedule_show_tooltip)
        self.widget.bind("<Leave>", self.hide_tooltip)

    def schedule_show_tooltip(self, event=None):
        if self.show_id is not None:
            self.widget.after_cancel(self.show_id)
        self.show_id = self.widget.after(500, self.show_tooltip)

    def show_tooltip(self, event=None):
        if self.tooltip_window:
            return
        x, y, _, _ = self.widget.bbox("insert")
        x += self.widget.winfo_rootx() + 25
        y += self.widget.winfo_rooty() + 25
        self.tooltip_window = tk.Toplevel(self.widget)
        self.tooltip_window.wm_overrideredirect(True)
        self.tooltip_window.wm_geometry(f"+{x}+{y}")
        label = tk.Label(self.tooltip_window, text=self.text, background="lightyellow", relief="solid", borderwidth=1, font=("Arial", 10))
        label.pack()

    def hide_tooltip(self, event=None):
        if self.show_id is not None:
            self.widget.after_cancel(self.show_id)
            self.show_id = None
        if self.tooltip_window:
            self.tooltip_window.destroy()
            self.tooltip_window = None

class PDFOCRApp:
    def __init__(self, root):
        self.root = root
        self.root.title("PDF OCR Converter")
        self.root.geometry("450x650")

        # Handle PyInstaller resource paths
        if hasattr(sys, '_MEIPASS'):
            self.base_path = sys._MEIPASS
        else:
            self.base_path = os.path.dirname(os.path.abspath(__file__))

        # Load base64 logo
        robot_input_base64 = ""  # Replace with your full base64 string
        try:
            image_data = base64.b64decode(robot_input_base64)
            image = Image.open(io.BytesIO(image_data))
            image = image.resize((150, 150), Image.Resampling.LANCZOS)
            self.logo_photo = ImageTk.PhotoImage(image)
            self.logo_label = tk.Label(root, image=self.logo_photo)
            self.logo_label.pack(pady=10)
        except Exception as e:
            #with open("debug_log.txt", "a") as log:
                #log.write(f"Failed to load logo: {str(e)}\n")
            messagebox.showwarning("Warning", "Failed to load logo.")

        self.label = tk.Label(root, text="Select a PDF to convert to searchable text", font=("Arial", 12))
        self.label.pack(pady=10)
        Tooltip(self.label, "Choose a PDF file to convert into a searchable PDF with OCR.")

        self.select_button = tk.Button(root, text="Select PDF", command=self.select_pdf, font=("Arial", 10))
        self.select_button.pack(pady=5)
        Tooltip(self.select_button, "Click to select a PDF file from your computer.")

        self.lang_label = tk.Label(root, text="Select OCR Language:", font=("Arial", 10))
        self.lang_label.pack(pady=5)
        self.lang_var = tk.StringVar(value="eng")
        self.lang_dropdown = ttk.Combobox(root, textvariable=self.lang_var, values=["eng", "fra", "deu", "spa"], state="readonly")
        self.lang_dropdown.pack(pady=5)
        Tooltip(self.lang_dropdown, "Select the language for OCR (e.g., 'eng' for English).")

        self.dpi_label = tk.Label(root, text="Select DPI (lower equals smaller file size/less accuracy):", font=("Arial", 10))
        self.dpi_label.pack(pady=5)
        self.dpi_var = tk.StringVar(value="300")
        self.dpi_dropdown = ttk.Combobox(root, textvariable=self.dpi_var, values=["200", "300", "400"], state="readonly")
        self.dpi_dropdown.pack(pady=5)
        Tooltip(self.dpi_dropdown, "Choose the DPI for image conversion (lower DPI = faster, but less reliable).")

        self.convert_button = tk.Button(root, text="Convert to Searchable PDF", command=self.start_conversion, state="disabled", font=("Arial", 10))
        self.convert_button.pack(pady=5)
        Tooltip(self.convert_button, "Start the conversion process to create a searchable PDF.")

        self.cancel_button = tk.Button(root, text="Cancel", command=self.cancel_conversion, state="disabled", font=("Arial", 10))
        self.cancel_button.pack(pady=5)
        Tooltip(self.cancel_button, "Cancel the ongoing conversion process.")

        self.progress = ttk.Progressbar(root, length=300, mode="determinate")
        self.progress.pack(pady=10)
        Tooltip(self.progress, "Shows the progress of the conversion process.")

        self.status_label = tk.Label(root, text="", font=("Arial", 10), wraplength=400)
        self.status_label.pack(pady=5)
        Tooltip(self.status_label, "Displays the current status of the conversion process.")

        self.timer_label = tk.Label(root, text="Elapsed Time: 00:00", font=("Arial", 10))
        self.timer_label.pack(pady=5)
        Tooltip(self.timer_label, "Shows the time taken for the conversion process.")

        self.clear_button = tk.Button(root, text="Clear", command=self.clear_app, font=("Arial", 10))
        self.clear_button.pack(pady=5)
        Tooltip(self.clear_button, "Reset the application to its initial state.")

        self.link_label = tk.Label(root, text="SchoolingDelaware.com", fg="blue", cursor="hand2")
        self.link_label.pack(pady=5)
        self.link_label.bind("<Button-1>", lambda e: webbrowser.open("https://schoolingdelaware.com/p/school-library-books"))
        Tooltip(self.link_label, "Click to visit SchoolingDelaware.com for school library books.")

        self.pdf_path = None
        self.cancel_flag = False
        self.start_time = None
        self.total_pages = 0
        self.current_page = 0
        self.average_time_per_page = 0
        self.is_command_line = False  # Flag to track command-line mode

        # Handle command line argument
        if len(sys.argv) > 1:
            pdf_file = sys.argv[1]
            if os.path.exists(pdf_file) and pdf_file.lower().endswith('.pdf'):
                self.pdf_path = pdf_file
                self.dpi_var.set("300")
                self.status_label.config(text=f"Selected: {os.path.basename(self.pdf_path)}")
                self.convert_button.config(state="normal")
                self.is_command_line = True  # Set command-line mode
                self.start_conversion()
            else:
                messagebox.showerror("Error", "Invalid PDF file provided.")
                self.root.after(0, self.root.destroy)  # Close GUI on invalid file

        #with open("debug_log.txt", "a") as log:
            #log.write(f"\n--- Starting new session at {time.ctime()} ---\n")

    def select_pdf(self):
        self.pdf_path = filedialog.askopenfilename(
            title="Select PDF File",
            filetypes=[("PDF Files", "*.pdf")]
        )
        if self.pdf_path:
            self.status_label.config(text=f"Selected: {os.path.basename(self.pdf_path)}")
            self.convert_button.config(state="normal")
            #with open("debug_log.txt", "a") as log:
                #log.write(f"Selected PDF: {self.pdf_path}\n")
        else:
            self.status_label.config(text="No file selected")

    def start_conversion(self):
        if not self.pdf_path:
            messagebox.showerror("Error", "Please select a PDF file first!")
            return
        self.convert_button.config(state="disabled")
        self.cancel_button.config(state="normal")
        self.cancel_flag = False
        self.status_label.config(text="Starting conversion...")
        self.progress["value"] = 0
        self.start_time = time.time()
        self.update_timer()
        self.thread = threading.Thread(target=self.convert_pdf, daemon=True)
        self.thread.start()

    def update_timer(self):
        if self.start_time and not self.cancel_flag:
            elapsed = time.time() - self.start_time
            minutes, seconds = divmod(int(elapsed), 60)
            self.timer_label.config(text=f"Elapsed Time: {minutes:02d}:{seconds:02d}")
            self.root.after(1000, self.update_timer)

    def cancel_conversion(self):
        self.cancel_flag = True
        self.root.after(0, lambda: self.status_label.config(text="Cancelling..."))
        self.root.after(0, lambda: self.cancel_button.config(state="disabled"))

    def convert_pdf(self):
        temp_files = []
        temp_output_pdf = None
        temp_resized_pdf = None
        original_max_pixels = Image.MAX_IMAGE_PIXELS
        Image.MAX_IMAGE_PIXELS = 200_000_000  # Set early for Step 2
        try:
            # Set dependency paths
            poppler_path = os.path.join(self.base_path, "poppler", "Library", "bin")
            tesseract_path = os.path.join(self.base_path, "tesseract", "tesseract.exe")
            if not os.path.exists(poppler_path):
                raise FileNotFoundError(f"Poppler not found at {poppler_path}")
            if not os.path.exists(tesseract_path):
                raise FileNotFoundError(f"Tesseract not found at {tesseract_path}")
            pytesseract.pytesseract.tesseract_cmd = tesseract_path
    
            def update_status(message, progress_value=None):
                self.root.after(0, lambda: self.status_label.config(text=message))
                if progress_value is not None:
                    self.root.after(0, lambda: self.progress.config(value=progress_value))
    
            # Initial console message
            print("PDF OCR Converter - Detailed Progress")
            print("=====================================")
            print(f"Starting conversion of '{os.path.basename(self.pdf_path)}' at {time.ctime()}")
            print(f"Selected DPI: {self.dpi_var.get()}, Language: {self.lang_var.get()}")
    
            # Step 1: Get source PDF dimensions and page count
            update_status("Analyzing PDF...", 0)
            print("Analyzing PDF structure...")
            pdf_reader = PdfReader(self.pdf_path)
            self.total_pages = len(pdf_reader.pages)
            page = pdf_reader.pages[0]
            media_box = page.mediabox
            source_width, source_height = media_box.width, media_box.height
            print(f"Found {self.total_pages} pages, dimensions: {source_width:.2f}x{source_height:.2f} points")
    
            # Step 2: Convert PDF to images (30% of progress)
            update_status("Converting PDF to images: 0 of {} pages processed...".format(self.total_pages), 0)
            print("Converting PDF pages to images...")
            images = []
            batch_size = 10
            pages_processed = 0
            max_pixels = 50_000_000  # Cap images at ~50 MP for OCR
            for start_page in range(1, self.total_pages + 1, batch_size):
                if self.cancel_flag:
                    update_status("Conversion cancelled.")
                    print("Conversion cancelled by user.")
                    self.root.after(0, self.reset_buttons)
                    return
                end_page = min(start_page + batch_size - 1, self.total_pages)
                batch_images = convert_from_path(
                    self.pdf_path,
                    dpi=int(self.dpi_var.get()),
                    poppler_path=poppler_path,
                    first_page=start_page,
                    last_page=end_page
                )
                # Resize large images to prevent memory issues
                for i, img in enumerate(batch_images):
                    pixel_count = img.width * img.height
                    if pixel_count > max_pixels:
                        scale = (max_pixels / pixel_count) ** 0.5
                        new_width = int(img.width * scale)
                        new_height = int(img.height * scale)
                        img = img.resize((new_width, new_height), Image.Resampling.LANCZOS)
                        print(f"Resized page {start_page + i} image: {img.width}x{img.height} pixels ({pixel_count:,} to {img.width * img.height:,} pixels)")
                    batch_images[i] = img
                images.extend(batch_images)
                pages_processed += len(batch_images)
                progress_value = 30 * (pages_processed / self.total_pages)
                update_status("Converting PDF to images: {} of {} pages processed...".format(pages_processed, self.total_pages), progress_value)
                print(f"Converted pages {start_page} to {end_page} to images")
    
            pdf_pages = []
            self.current_page = 0
            total_ocr_time = 0
    
            # Step 3: Process each page with OCR (60% of progress)
            update_status("Processing page 1 of {}...".format(self.total_pages), 30)
            print("Applying OCR to images...")
            for i, image in enumerate(images):
                if self.cancel_flag:
                    update_status("Conversion cancelled.")
                    print("Conversion cancelled by user.")
                    self.root.after(0, self.reset_buttons)
                    return
                self.current_page = i + 1
                image = image.convert("RGB")
                start_time = time.time()
                pdf_page = pytesseract.image_to_pdf_or_hocr(image, extension='pdf', lang=self.lang_var.get())
                elapsed_time = time.time() - start_time
                if elapsed_time > 60:
                    raise TimeoutError(f"OCR processing for page {i + 1} took too long (>60s).")
                total_ocr_time += elapsed_time
                self.average_time_per_page = total_ocr_time / self.current_page
                pdf_pages.append(pdf_page)
                progress_value = 30 + (60 * (self.current_page / self.total_pages))
                remaining_pages = self.total_pages - self.current_page
                estimated_remaining_time = remaining_pages * self.average_time_per_page
                remaining_minutes, remaining_seconds = divmod(int(estimated_remaining_time), 60)
                update_status(
                    f"Processing page {self.current_page} of {self.total_pages}... "
                    f"(Est. time remaining: {remaining_minutes:02d}:{remaining_seconds:02d})",
                    progress_value
                )
                print(f"Processed page {self.current_page}/{self.total_pages} in {elapsed_time:.2f} seconds")
    
            # Step 4: Merge pages into temporary PDF (5% of progress)
            input_dir = os.path.dirname(self.pdf_path)  # Get input PDF's directory
            base_name = os.path.splitext(os.path.basename(self.pdf_path))[0]
            output_pdf = os.path.join(input_dir, f"{base_name}_searchable.pdf")  # Explicitly use input directory
            temp_output_pdf = os.path.join(input_dir, f"{base_name}_temp.pdf")
            # Check if output directory is writable
            if not os.access(input_dir, os.W_OK):
                raise PermissionError(f"No write permission in directory: {input_dir}")
            update_status("Merging pages into temporary PDF...", 90)
            print("Merging OCR pages into temporary PDF...")
            merger = PdfWriter()
            for i, pdf_page in enumerate(pdf_pages):
                temp_pdf = os.path.join(input_dir, f"temp_page_{i}.pdf")  # Save temp files in input directory
                with open(temp_pdf, "wb") as f:
                    f.write(pdf_page)
                temp_files.append(temp_pdf)
                merger.append(temp_pdf)
            merger.write(temp_output_pdf)
            merger.close()
            print("Temporary PDF created.")
    
            # Step 5: Resize to source dimensions (2.5% of progress)
            update_status("Resizing PDF to original dimensions...", 92.5)
            print("Resizing PDF to match original dimensions...")
            src = fitz.open(temp_output_pdf)
            doc = fitz.open()
            for page in src:
                new_page = doc.new_page(width=source_width, height=source_height)
                new_page.show_pdf_page(new_page.rect, src, page.number)
            temp_resized_pdf = os.path.join(input_dir, f"{base_name}_temp_resized.pdf")
            doc.ez_save(temp_resized_pdf)
            src.close()
            doc.close()
            print("Resized PDF created.")
    
            # Step 6: Downsample pages to target DPI (2.5% of progress)
            target_dpi = 150
            update_status(f"Downsampling PDF to {target_dpi} DPI...", 95)
            print(f"Downsampling pages to {target_dpi} DPI to reduce file size...")
            src = fitz.open(temp_resized_pdf)
            doc = fitz.open()
            try:
                for page_number, page in enumerate(src):
                    if self.cancel_flag:
                        update_status("Conversion cancelled.")
                        print("Conversion cancelled by user.")
                        self.root.after(0, self.reset_buttons)
                        return
                    # Calculate target resolution
                    width_in = source_width / 72
                    height_in = source_height / 72
                    pix_width = int(width_in * target_dpi)
                    pix_height = int(height_in * target_dpi)
                    print(f"Page {page_number + 1}: Target resolution {pix_width}x{pix_height} pixels at {target_dpi} DPI")
                    
                    # Calculate effective DPI of the source image (from Step 2)
                    src_pix = page.get_pixmap()  # Default DPI (72)
                    src_width = src_pix.width
                    src_height = src_pix.height
                    effective_dpi_width = (src_width / width_in)  # DPI = pixels / inches
                    effective_dpi_height = (src_height / height_in)
                    effective_dpi = min(effective_dpi_width, effective_dpi_height)
                    print(f"Page {page_number + 1}: Effective source DPI {effective_dpi:.2f}")
                    
                    # Decide whether to downsample
                    if effective_dpi <= target_dpi:
                        print(f"Page {page_number + 1}: Skipping downsampling (source DPI {effective_dpi:.2f} <= target {target_dpi})")
                        pix = src_pix  # Use original resolution
                    else:
                        pix = page.get_pixmap(matrix=fitz.Matrix(target_dpi / 72, target_dpi / 72))
                    
                    # Convert to image
                    img = Image.frombytes("RGB", [pix.width, pix.height], pix.samples)
                    
                    # Safety check
                    pixel_count = pix.width * pix.height
                    if pixel_count > 500_000_000:
                        print(f"Skipping page {page_number + 1} (too large: {pixel_count:,} pixels)")
                        continue
                    
                    # Save image with compression
                    img_buffer = io.BytesIO()
                    img.save(img_buffer, format="JPEG", quality=65, optimize=True)
                    img_bytes = img_buffer.getvalue()
                    print(f"Page {page_number + 1}: Compressed image size {len(img_bytes) / 1024:.2f} KB")
                    
                    # Create new page
                    new_page = doc.new_page(width=source_width, height=source_height)
                    
                    # Insert downsampled image
                    img_rect = fitz.Rect(0, 0, source_width, source_height)
                    new_page.insert_image(img_rect, stream=img_bytes)
                    
                    # Transfer text (OCR layer) as invisible
                    shape = new_page.new_shape()
                    text = page.get_text("dict")
                    if text.get("blocks"):
                        for block in text["blocks"]:
                            if block["type"] == 0:  # Text block
                                for line in block["lines"]:
                                    for span in line["spans"]:
                                        shape.insert_text(
                                            (span["origin"][0], span["origin"][1]),
                                            span["text"],
                                            fontname="helv",
                                            fontsize=span["size"],
                                            render_mode=3  # Invisible but searchable
                                        )
                    shape.commit()
                    print(f"Processed page {page_number + 1}: Downsampled and text transferred")
            
                # Optimize PDF
                doc.ez_save(output_pdf, garbage=4, deflate=True)
                print(f"Downsampled PDF saved as '{os.path.basename(output_pdf)}'")
            finally:
                src.close()
                doc.close()
    
            update_status(f"Conversion complete! Saved as: {os.path.basename(output_pdf)}", 100)
            if not self.is_command_line:  # Skip messagebox in command-line mode
                self.root.after(0, lambda: messagebox.showinfo("Success", f"Searchable PDF saved as:\n{output_pdf}"))
            print(f"Conversion complete. Output file size: {os.path.getsize(output_pdf) / (1024 * 1024):.2f} MB")
            print("=====================================")
    
        except Exception as e:
            error_msg = f"An error occurred: {str(e)}"
            update_status(f"Error: {error_msg}")
            print(f"ERROR: {error_msg}")
            print("=====================================")
            if not self.is_command_line:  # Skip messagebox in command-line mode
                self.root.after(0, lambda: messagebox.showerror("Error", error_msg))
        finally:
            Image.MAX_IMAGE_PIXELS = original_max_pixels
            for temp_file in temp_files:
                try:
                    if os.path.exists(temp_file):
                        os.remove(temp_file)
                except:
                    pass
            if temp_output_pdf and os.path.exists(temp_output_pdf):
                try:
                    os.remove(temp_output_pdf)
                except:
                    pass
            if temp_resized_pdf and os.path.exists(temp_resized_pdf):
                try:
                    os.remove(temp_resized_pdf)
                except:
                    pass
            self.root.after(0, self.reset_buttons)  # Call reset_buttons for cleanup
		
    def reset_buttons(self):
        self.convert_button.config(state="normal" if self.pdf_path else "disabled")
        self.cancel_button.config(state="disabled")
        self.start_time = None
        if self.is_command_line:
            self.root.after(0, self.root.destroy)  # Close GUI in command-line mode

    def clear_app(self):
        self.pdf_path = None
        self.status_label.config(text="")
        self.progress["value"] = 0
        self.convert_button.config(state="disabled")
        self.cancel_button.config(state="disabled")
        self.lang_var.set("eng")
        self.dpi_var.set("300")
        self.timer_label.config(text="Elapsed Time: 00:00")
        self.start_time = None
        self.total_pages = 0
        self.current_page = 0
        self.average_time_per_page = 0

def main():
    # Print welcome message to console
    print("=====================================")
    print("PDF OCR Converter - Console Information")
    print("=====================================")
    print("This console window provides detailed progress updates during the PDF conversion process.")
    print("Please do not close this window while the application is running.")
    print("To start, select a PDF file and click 'Convert to Searchable PDF' in the application window.")
    print("=====================================\n")
	
    root = tk.Tk()
    app = PDFOCRApp(root)
    root.mainloop()

if __name__ == "__main__":
    main()